import React from 'react';
import '../css/Main.css'
import 'bootstrap/dist/css/bootstrap.css';

function main () {
    return(
        <div className="MainButtons" >
            <button onClick='/homeP' type="button" class="btn btn-warning btn-lg" >Login</button>
            <button id="RegisterButton" type="button" class="btn btn-warning btn-lg">Register</button>
        </div>      
        
    );
    
}
export default main;
